import React from 'react';
import '../styles/Home.css'; // Link to your CSS file
const history = useHistory(); // Hook to access the history object

  // Navigate to the About Us page
  const handleReadMoreClick = () => {
    history.push('/about');
  };
const Home = () => {
  return (
    <div className="home-container">
      <header className="home-header">
        <h1>EndangeraProtect</h1>
      </header>
      <div className="mission-section">
        <div className="mission-content">
          
          <h3>
            Together for the Endangered  animals
          </h3>
          
          <button className="read-more" onClick={handleReadMoreClick}>About us</button>
        </div>
        <div className="mission-image">
          <img src="/assets/backgorundimg.jpg" alt="Cheetah in the wild" />
        </div>
      </div>
     
    </div>
  );
};

export default Home;
